import React from 'react'

import styled  from "styled-components"
import MenuIcon from '@material-ui/icons/Menu';
import CloseIcon from '@material-ui/icons/Close';
function header() {
    return (
        <Container>
        <a>
          <img src= "/images/logo.svg" />  
        </a>  
        <Menu>
           <a href="#">Model S</a>
           <a href="#">Model 3</a>
           <a href="#">Model X</a>
           <a href="#">Model Y</a>
           <a href="#">Solar Panel</a> 
           <a href="#">Solar Roof</a>
        </Menu>

            <RightMenu>
            <a href="#">Shop</a>
                <a href="#">Account</a>                
                </RightMenu> 
                <CustomMenu>
              
                </CustomMenu>
                <BurgerNav>
                     <CustomClose></CustomClose>
                <li><a href="#"> Existing Inventory</a></li>
                <li><a href="#"> Existing Inventory</a></li>
                <li><a href="#"> Existing Inventory</a></li>
                <li><a href="#"> Existing Inventory</a></li>
                <li><a href="#"> Existing Inventory</a></li>
                <li><a href="#"> Existing Inventory</a></li>
            </BurgerNav>

        </Container>
    )
}

export default header

const Container = styled.div`
min-height:60 px;
position:fixed;
align-items:center;
justify-content: space
display:flex;
top:0;
left:0;
right:0;
z-index:1;
`

const Menu = styled.div`
display:flex;
align-items;center;
flex:1;
justify-content:center;
a{
    font-weight:600;
    text-decoration:uppercase;
    padding:0 10px;
}
@media(max-width: 768px){
    display:none;
}

`

const RightMenu = styled.div`
display:flex:
align-items:center;
a{
    font-weight:600;
    text-decoration:uppercase;
    padding:0 10px;
    margin-right:10px;
}
`
const CustomMenu= styled(MenuIcon)`
cursor:pointer;

`
const BurgerNav = styled.div`
position:fixed;
top:0;
right:0;
bottom:0;
background:#ffffff;
width:300px;
z-index:16;
list-style:none;
padding:20px;
flex-direction:column;
text-align:start;
li{
    padding: 15px 0;
    border-bottom:1px solid rgba(0,0,0, .2);
    a{
        font-weight:600;
    }
}
`

const CustomClose = styled.div`


`
